import React from "react";
import PostTd from "./Test_PostTd";

interface PostItem {
  order: number;
  name: string;
  date: string;
  title: string;
  content: string;
}

interface PostTrProps {
  user_data: Array<PostItem>;
}

const PostTr: React.FC<PostTrProps> = ({ user_data }) => {
  console.log("start");
  console.log(user_data[0]);
  console.log(user_data[1]);
  console.log(user_data[2]);
  console.log(user_data[3]);
  console.log(user_data[4]);
  return (
    <tbody>
      {user_data.map((item) => (
        <PostTd item={item} />
      ))}
    </tbody>
  );
};

export default PostTr;
